import React from "react";

const HouseListing = () => {
  const houses = [
    { id: 1, location: "Nairobi, Westlands", category: "Single Room", price: 20000, image: "house1.jpg" },
    { id: 2, location: "Kilimani, Nairobi", category: "One-Bedroom", price: 35000, image: "house2.jpg" },
    { id: 3, location: "Umoja, Eastlands", category: "Bedsitter", price: 12000, image: "house3.jpg" },
  ];

  return (
    <div className="p-10 bg-gray-100 grid grid-cols-1 md:grid-cols-3 gap-6">
      {houses.map((house) => (
        <div key={house.id} className="bg-white p-4 shadow-lg rounded-lg overflow-hidden">
          <img src={house.image} alt={house.category} className="w-full h-48 object-cover mb-4 rounded-lg" />
          <h3 className="text-xl font-semibold">{house.category}</h3>
          <p className="text-gray-700"><strong>Location:</strong> {house.location}</p>
          <p className="text-gray-700"><strong>Price:</strong> KSh {house.price}</p>
        </div>
      ))}
    </div>
  );
};

export default HouseListing;
